import {Route} from 'react-router-dom';
import MainHeader from './Components/MainHeader';
import Product from './pages/Products';
import Welcome from './pages/Welcome';

function App() {
  return (
    <div>
      <MainHeader></MainHeader>
      <main>
      <Route path = '/welcome'>
        <Welcome></Welcome>
      </Route>
      <Route path = '/products'>
        <Product></Product>
      </Route>
      </main>
    </div>
  );
}

export default App;
